create table t_task_patrolman
(
    id           BIGINT(19) auto_increment
        primary key,
    task_id      BIGINT(19)   null comment '任务id',
    patrolman_id BIGINT(19)   null comment '巡更人员id',
    patrolman    VARCHAR(255) null comment '巡更人员名称',
    phone        VARCHAR(255) null comment '电话',
    dept_id      BIGINT(19)   null comment '辖区'
)
    charset = utf8mb4;

